const Generations = ({changeGeneration}) => {
    return (
        <div>
            <span onClick={() => changeGeneration('yellow')}>I</span>
            <span>II</span>
            <span>III</span>
            <span>IV</span>
            <span>V</span>
            <span>VI</span>
        </div>
    )
}

export default Generations
